        this.nodes.forEach((node) => this.nodesByExternalReferenceIdMap.set(node.externalReferenceId, node));
        this.findHighestNode();
        this.nodeDepth = ((_a = this.highestNode) === null || _a === void 0 ? void 0 : _a.nodeDepth) || 0;
        this.parentLevel = parentLevel;
