    setMinMax(worldMin, min, max) {
        this.worldMin = worldMin.clone();
        this.min = min.clone();
        this.max = max.clone();
        this.currentLocalTopPlanePosition = max.clone();
        this.currentLocalBottomPlanePosition = worldMin.clone();
    }
    setPos(minPos, maxPos) {
        return this.animatePlanes(minPos, maxPos, Easing.Cubic.InOut, 500);
    }
